import React, { Component } from 'react'
import axios from 'axios';
export default class GetCategory extends Component {

    
componentDidMount(){
axios.get("https://localhost:44314/api/Category/1").then(res=>{
JSON.parse(res.data)
}).then(res);
}
    render() {
        return (
            <div>
                Get Some Category
            </div>
        )
    }
}
